        margin: { t: 60, l: 60, r: 30, b: 60 }
      };

      Plotly.newPlot("chart", traces, layout, {responsive: true});
    }

    countries.forEach(c => {
      const opt = document.createElement("option");
      opt.value = c;
      opt.textContent = c;
      sel.appendChild(opt);
    });

    makeCheckboxes();

    const idx = countries.indexOf("Belgium");
    sel.selectedIndex = (idx >= 0) ? idx : 0;

    sel.addEventListener("change", plot);
    SERIES.forEach(s => document.getElementById("cb_" + s).addEventListener("change", plot));

    plot();
  </script>
</body>
</html>
